project:
1. Dengan multimedia interaktif, peserta didik mampu menentukan hasil penjumlahan pecahan campuran penyebut sama dengan benar;
2. Dengan multimedia interaktif, peserta didik mampu menganalisis penyelesaian masalah terkait hasil penjumlahan pecahan campuran penyebut beda dengan benar;
3. Dengan multimedia interaktif, peserta didik mampu menentukan hasil pengurangan pecahan campuran penyebut sama dengan benar;
4. Dengan multimedia interaktif, peserta didik mampu menganalisis penyelesaian masalah terkait pengurangan pecahan campuran penyebut beda dengan benar;

Tujuan yang akan dicapai pada latihan 1 agar
peserta didik dapat:
1. menentukan hasil penjumlahan pecahan campuran penyebut sama dengan benar;
2. menganalisis pemecahan masalah terkait penjumlahan pecahan campuran penyebut beda dengan benar;

Tujuan yang akan dicapai pada latihan 2 agar
peserta didik dapat:
1. menentukan hasil pengurangan pecahan campuran penyebut sama dengan benar;
2. menganalisis pemecahan masalah terkait pengurangan pecahan campuran penyebut beda dengan benar;
